import React from "react";



import { Outlet, Link} from "react-router-dom";

import "./BenchCalculator.scss"

const BenchCalculator = () => {

    return (
        <div className="bench__calculator__wrapper">
            <div className="title">
            <a href="https://www.benchcalculator.com/">BenchCalculator.com</a>
            </div>
            <div className="content">
                This site originally started out as a passion project but also helped me hone my React and CSS skills.
                The purpose of the site is to aid weight-lifters, specifically those performing the bench press, to be able
                to determine their One Rep Max. This means the maximum ammount of wieght they can do for a single rep.
                They are able to enter a previous lift the've done (weight lifted and reps performed) and the website will 
                then calculate their One Rep Max. It is calculated using the Epley formula. 
                Soon, It will compound many formulas to get a more diversified answer.
                <a href="https://www.benchcalculator.com/">BenchCalculator.com</a>
            </div>
        </div>
    )
}

export default BenchCalculator;
